import React from 'react';

const MyReports = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold text-gray-800 mb-6">My Reports</h1>
      <div className="bg-white rounded-lg shadow-md p-6">
        <div className="mb-4">
          <h2 className="text-xl font-semibold text-gray-800 mb-2">Lost Items</h2>
          <div className="space-y-4">
            {/* Example lost item report */}
            <div className="bg-gray-50 p-4 rounded">
              <h3 className="text-lg font-semibold mb-2">iPhone 13 Pro</h3>
              <p className="text-gray-600">Last seen at Central Park</p>
              <p className="text-sm text-gray-500">Reported on July 3, 2025</p>
            </div>
          </div>
        </div>
        <div>
          <h2 className="text-xl font-semibold text-gray-800 mb-2">Found Items</h2>
          <div className="space-y-4">
            {/* Example found item report */}
            <div className="bg-gray-50 p-4 rounded">
              <h3 className="text-lg font-semibold mb-2">Black Leather Wallet</h3>
              <p className="text-gray-600">Found at Starbucks on 5th Ave</p>
              <p className="text-sm text-gray-500">Reported on July 3, 2025</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default MyReports;
